# Initial data visualization {#sec-Expl_Visualization}

When analyzing neuroscientific data, one of the first steps should be to explore the distribution and patterns of the measurements. Before fitting statistical models, it is always wise to understand what the raw data look like. There are common visualizations to perform these task, including density plots, scatter plots, and violin plots, among others. Take into account that many patterns might not be obvious from summary statistics alone and visuals can help us to guide decisions about modeling strategies.

For instance, consider a dataset where we measure certain characteristics of PDGFR-β  and GFAP-positive cells following experimental cerebral ischemia, a technique I employed in my research for almost a decade. We might be interested on how GFAP intensity increases in the ischemic hemisphere following injury. Visualizing these distributions can help us to see whether the data cluster around certain values, whether there are multiple peaks, or whether some observations are extreme values. Likewise, exploring how two variables relate to each other using scatter plots can reveal correlations, nonlinear patterns, or distinct subgroups, among many other aspects. Details we can focus on are indeed, endless.

Below, we will perform and exercise of exploratory data analysis with a real dataset from my own research. Our main tool will be `ggplot`. We start by generating density plots for our variables of interest: `Gfap_InDent` (GFAP integrated density) and `Pdgfrb_IntDen` (PDGFR-β integrated density). These are the intensity values for PDGFR-β and GFAP-expressing cells as measured in FIJI. 







