## Ploting denisty distributions  

Before, we create a theme plot to use with out ggplots. This will stadanrize the way we present the graphs and add some easthetics to improve the visulatization. We will call this object `Plot_theme` and will be vaiable in the functions folder of the GitHub repo.





::: {.cell}

```{.r .cell-code}
library(ggplot2)

Plot_theme <- theme_classic() +
  theme(
    plot.title = element_text(size=18, hjust = 0.5, face="bold"),
    plot.subtitle = element_text(size = 10, color = "black"),
    plot.caption = element_text(size = 12, color = "black"),

    axis.line = element_line(colour = "black", linewidth = 1.5, linetype = "solid"),
    axis.ticks.length=unit(7,"pt"),

    axis.title.x = element_text(colour = "black", size = 16),
    axis.text.x = element_text(colour = "black", size = 16, angle = 0, hjust = 0.5),
    axis.ticks.x = element_line(colour = "black", linewidth = 1),

    axis.title.y = element_text(colour = "black", size = 16),
    axis.text.y = element_text(colour = "black", size = 16),
    axis.ticks.y = element_line(colour = "black", linewidth = 1),

    legend.position="right",
    legend.direction="vertical",
    legend.title = element_text(colour="black", face="bold", size=12),
    legend.text = element_text(colour="black", size=10),

    plot.margin = margin(t = 10,  # Top margin
                         r = 2,  # Right margin
                         b = 10,  # Bottom margin
                         l = 10) # Left margin
  ) 
```
:::





Now, we plot both variables using `geom_density` to get, as its name suggest, density plots for both variables. Also, we plot the graphs side by side with the help of `patchwork`. Note that we specify for ggplot our dataset `cell_data` and define what to plot in the x-axis using `aes`. By default, `geom_density` using the y-axis to create a denisty distribution with the variable we specify in the x-axis. Look carefully all the other elements you can use to costumize your plot.





::: {.cell}

```{.r .cell-code}
library(patchwork)

# Density plot for Pdgfrb_Intensity
Pdgfrb_dens <- ggplot(
  data = cell_data, 
  aes(x = Pdgfrb_IntDen)) +
  geom_density(fill = "red", alpha = 0.5) +
  Plot_theme +
  labs(title = "Denisity of PDGFR-β Intensity", 
       subtitle = "Density plot",
       x = "PDGFR-β Intensity", 
       y = "Density")

# Density plot for Gfap_Intensity
Gfap_dens <- ggplot(
  data = cell_data, 
  aes(x = Gfap_IntDen)) +
  geom_density(fill = "lightgreen", alpha = 0.5) +
  Plot_theme +
  labs(title = "Density of GFAP Intensity", 
       subtitle = "Density plot",
       x = "Gfap Intensity", 
       y = "Density")

# We render the graphs side by side using pathwork  
Pdgfrb_dens + Gfap_dens 
```

